import itertools

nums = [2, 3, 4, 5, 1]
ops = ['*', '*', '*', '+']

def compute(a, op, b):
    if op == '*':
        return a * b
    else:  # '+'
        return a + b

from functools import lru_cache

@lru_cache(None)
def eval_range(i, j):
    # evaluate subexpression from nums[i] to nums[j] inclusive
    if i == j:
        return {nums[i]}
    results = set()
    # operator positions between i and j
    for k in range(i, j):
        left_vals = eval_range(i, k)
        right_vals = eval_range(k+1, j)
        op = ops[k]  # operator after nums[k]
        for lv in left_vals:
            for rv in right_vals:
                results.add(compute(lv, op, rv))
    return results

all_vals = eval_range(0, len(nums)-1)
print(len(all_vals))
print(sorted(all_vals))

