import Mathlib.Data.Int.Basic
import Mathlib.Data.List.Basic

def add (p q : Int × Int) : Int × Int := (p.1 + q.1, p.2 + q.2)
def sub (p q : Int × Int) : Int × Int := (p.1 - q.1, p.2 - q.2)

def candidate (a b c : Int × Int) : List (Int × Int) :=
  [ add a (sub b c),                -- a + (b - c)
    add b (sub c a),                -- b + (c - a)
    add c (sub a b) ]               -- c + (a - b)

def solve : Int :=
  let a : Int × Int := (5, 3)
  let b : Int × Int := (6, 8)
  let c : Int × Int := (7, 4)
  let cand := candidate a b c
  match cand.filter (fun p => p.1 > 7) with
  | [p] => p.1 + p.2
  | _   => 0

#eval solve

